import React from 'react';
import './App.css';
import MainPageWithMenu from './Components/mainPageWithMenu.js'
import HeaderImage from './Components/headerImage'
import HeaderText from './Components/headerText'
import Footer from './Components/footer'


function App() {
  return (
  <div id="mainContainer">
    <div id="header">
      <HeaderImage/>
      <HeaderText/>
      <img src={require('../images/asterrisk.png')} className='rotate'/>
    </div>
    <MainPageWithMenu/>
    <Footer/>
  </div>
  );
}
export default App;
